  return (
    <div className="p-6">
      <h1 className="text-xl font-bold">My Profile</h1>
      <p><strong>Name:</strong> Sargam Shirke</p>
      <p><strong>Resume:</strong> [Resume File/Link]</p>
      <p><strong>Skills:</strong> HTML, CSS, JavaScript, React, MongoDB, Node.js</p>
    </div>
  );
}

